  [],\n\t\"revision_timestamp\": \"2016-07-27T23:06:13.621079\",\n\t\"name\": \"willapa-nwr-initial-survey-instructions-for-coastal-pollinator-habitat-assessment\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The federally threatened Oregon silverspot
  butterfly is currently extirpated from Washington. The Refuge staff is actively
  involved in restoring habitat for this listed species (see Sections 4.3 and 4.9
  of the Willapa NWR CCP). Assessing habitat conditions provides important data needed
  for the adaptive management strategy used in the habitat restoration process currently
  underway at the Refuge. Pollinators are also important to other habitats being restored
  and thus evaluating the quality and quantity of pollinator habitat is a measure
  of the efficacy of those restoration projects.The objective of this survey is to
  collect data on habitats important to pollinators for the purpose of prioritizing
  conservation actions and quantifying habitat restoration or land management improvements
  at individual sites. These data are intended to help refuge staff incorporate pollinator
  conservation into refuge and landscape management planning and to document improvements
  in pollinator habitat resulting from specific actions and management practices using
  standardized, repeatable I&M methods. Data collected include landscape and site-level
  features, pollinator foraging habitat characteristics, native bee nesting habitat
  availability and quality, and management practices in and around pollinator habitat
  areas. These data can also be used to correlate changes in pollinator populations
  over time to see what the results of land management actions (e.g., vegetation manipulations)
  may have on pollinator populations.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
